import React from 'react';
import Mac from './icons/Mac.js';
import iPhone from './icons/iPhone.js';
import iPad from './icons/iPad.js';
import Android from './icons/Android.js';
import PC from './icons/PC.js';

const iconMap = {
    'A': Android,
    'B':iPad,
    'C':iPhone,
    'D':Mac,
    'E':PC
}

function Device({deviceType='A',color='sky-400',top=0,left=0}) {
    const DeviceIcon = iconMap[deviceType];
    return (
        <div className={`absolute rounded-full ${color} w-10 h-10 drop-shadow-xl top-${top} left-${left}`}>
        <DeviceIcon/>
        </div>
    )
}

export default Device;
